import "./App.css";
import { Navbar } from "./Navbar";
import { Pill } from "./Pill";

import { WritingEntry } from "./WritingEntry";

export function Writing() {
  return (
    <div
      style={{ maxWidth: 450, margin: "0% auto", padding: 16, fontSize: 14 }}
    >
      <Navbar />

      <WritingEntry
        title={"Say Hello to Athelas One"}
        date={"October 29, 2021"}
        tags={["Athelas", "Healthcare"]}
        description="Athelas One is a 3-minute blood diagnostics tool that segments and counts the hematology composition of an individual's blood. With just a single drop of blood it automatically focuses, captures high resolution imagery, and pushes those images through a machine learning model to determine the concentration of different WBCs (white blood cells) in one’s blood ..."
      />

      <WritingEntry
        title={'The Cal Hacks Fellowship: Transcending Beyond "the Hack"'}
        date={"April 5, 2018"}
        tags={["Cal Hacks", "Hackathons"]}
        description="We started the Cal Hacks Fellowship, a program that provides an infrastructure for hackers that want to pursue their projects after the conclusion of the hackathon."
      />

      <WritingEntry
        title={"Athelas"}
        tags={["Growth Engineer", "Healthcare"]}
        description="Athelas is a fast-growing Series-B stage healthcare startup. Our mission is to bring modern healthcare services to patients with chronic illnesses to dramatically improve their health outcomes and ultimately reduce the cost of care. "
      />

      <WritingEntry
        title={"Athelas"}
        tags={["Growth Engineer", "Healthcare"]}
        description="Athelas is a fast-growing Series-B stage healthcare startup. Our mission is to bring modern healthcare services to patients with chronic illnesses to dramatically improve their health outcomes and ultimately reduce the cost of care. "
      />
    </div>
  );
}
